import React, { Component } from "react";
import logo from "../logo.svg";
import { Link, animateScroll as scroll } from "react-scroll";

const Navbar = (aboutFocus, resumeFocus) => {
  const scrollToTop = () => {
    scroll.scrollToTop();
  };
  return (
    <nav className="nav" id="navbar">
      <div className="nav-content">
        <img
          src={logo}
          className="nav-logo"
          alt="Logo"
          onClick={scrollToTop()}
        />
        <ul className="nav-items">
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section1"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
            >
              About
            </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section2"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
            >
              Resume
            </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section3"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
            >
              Portfolio
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
}
export default Navbar;
